import React from 'react';
import { styled } from 'styled-components';

const Header = () => {
  return (
    <div>
      <div>
        <span>스토어</span>
        <span>룩북</span>
        <span>매거진</span>
        <span>브랜드 소개</span>
        <span>NEW ARRIVAL</span>
        <span>SWIM WEAR</span>
      </div>
      <div>
        <img src='https://wiisnt.co.kr/images/cm_logo_1_02.svg' width={100}/>
      </div>
    </div>
  )
}

export default Header;
